# letter-<span class="flicker">flicker</span>
Flicks letters!

## Quickstart

    <script src="path/to/letter-flicker.js"></script>

    <script>
        var flickIt = new letterFlicker({
            element: document.querySelector('.flicker'),
            words: [
                'objects',
                'circuits',
                'tape',
                'paper',
                'hammers'
            ],
            rest: 5000
        });

        setTimeout(function() {
            flickIt.init();
        }, 5000);
    </script>

## Browser support

Requires ES5 support.

<script src="./letter-flicker.js"></script>

<script>
    var flickIt = new letterFlicker({
        element: document.querySelector('.flicker'),
        words: [
            'flickit',
            'flicked',
            'fucker'
        ],
        rest: 5000
    });

    setTimeout(function() {
        flickIt.init();
    }, 5000);
</script>
